import React, { useEffect, useState } from 'react';
import axios from 'axios';


interface Team {
  position: number;
  team: string;
  played: number;
  won: number;
  lost: number;
  points: number;
}

const LeagueTable: React.FC = () => {
  const [table, setTable] = useState<Team[]>([]);

  useEffect(() => {
    // Fetch the league table data from the backend API
    axios.get<Team[]>('http://localhost:5000/api/league')
      .then((response) => {
        setTable(response.data);
      })
      .catch((error) => {
        console.error('Error fetching league data:', error);
      });
  }, []);

  return (
    <div className="table-container">
      <h3>League Table</h3>
      <table>
        <thead>
          <tr>
            <th>Position</th>
            <th>Team</th>
            <th>Played</th>
            <th>Won</th>
            <th>Lost</th>
            <th>Points</th>
          </tr>
        </thead>
        <tbody>
          {table.map((team) => (
            <tr key={team.position}>
              <td>{team.position}</td>
              <td>{team.team}</td>
              <td>{team.played}</td>
              <td>{team.won}</td>
              <td>{team.lost}</td>
              <td>{team.points}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default LeagueTable
